import Row from "antd/lib/row";
import Col from "antd/lib/col";

import Select from "antd/lib/select";
const { Option } = Select;

import { NV } from 'one-micro';

interface Props {
}

export const Patient = (props: Props) => {
    return (
        <>
            <Row >
                <Col span={4}>
                </Col>
                <Col span={20}>
                    <Select value="1" style={{ fontSize: '.8rem', width: "100%" }}>
                        <Option style={{ fontSize: '.8rem' }} value="1">Doe, John</Option>
                    </Select>
                </Col>
            </Row>
            <Row>
                <Col span={4}>
                </Col>
                <Col span={10}>
                    <NV name='Name' value={'Doe, John'} />
                    <NV name='Name' value={['Doe, John', 'ddd']} />
                </Col>
                <Col span={10}>
                    <NV name='Address' value={['street-1, street-2', 'TX, 55505']} />
                </Col>
            </Row>
        </>
    );
};

